(169, 'Uberstone', 'uberstone', NULL, 66, NULL, NULL, '<p>Look your best, wether it&#39;s your Wedding, black tie gala, school formal or any event that requires a premium formal Hire suit&nbsp; Let us help you look fantastic with one of our high quality woolen hire dinner suits.</p>', '123', NULL, NULL, NULL, 'files/Brands/uberstone_logo_black(1).png', 'files/page-banners/SuitHiretemplate.png', 123, 0, 0, 1, 'suit hire, suit hire Adelaide, suit hire south Australia, mens suit hire, formal wear, school formal, suits, formal suit hire', 'Suit hire Adelaide south Australia, for weddings and school formals', 1630652360, NULL, 1659663503, 5),
(171, 'Cambridge', 'cambridge', NULL, 71, NULL, NULL, '<p>Quality Premium Pure wool Suits for the man who enjoys good clothing</p>', NULL, NULL, NULL, NULL, 'files/Brands/Cambridge_Logo(1).png', 'files/page-banners/Banner-2suit.png', 4, 0, 0, 1, NULL, NULL, 1633091675, NULL, 1664418487, 5),
(172, 'Gibson', 'gibson', NULL, 68, NULL, NULL, '<p>Look your best, wether it&#39;s your Wedding, black tie gala, school formal or any event that requires a premium formal Hire suit or tuxedo. Let us help you look fantastic with one of our high quality woolen hire dinner suits.</p>', '124', NULL, NULL, NULL, 'files/Brands/Gibson_Black_NEW_tUy1eQ0(1).jpg', 'files/page-banners/SuitHiretemplate.png', 124, 0, 0, 1, 'suit hire, suit hire Adelaide, suit hire south Australia, mens suit hire, formal wear, school formal, suits, formal suit hire', 'Suit hire Adelaide south Australia, for weddings and school formals', 1630652360, NULL, 1659681535, 5),
(174, 'Joe Black', 'joe-black', NULL, 71, NULL, NULL, '<div class=\"shopify-section\" id=\"shopify-section-about-text\">\r\n<div class=\"section--text-block\">\r\n<h2>&nbsp;</h2>\r\n\r\n<h1>Joe Black</h1>\r\n\r\n<p>THE MACKY CLAN SAILED FROM SCOTLAND BEFORE NEW ZEALAND HAD ELECTRICITY OR PROPER SEWERS. IN A FRONTIER SETTLEMENT BOTH RAW AND REFINED, JOE TAILORED A CLIENTELE RANGING FROM BRAWLERS TO BARRISTERS IN GARMENTS TO SERVICE THEM THROUGH LIFE&rsquo;S LANDMARKS, FROM SEDUCTION TO DEPOSITION, BAPTISM TO WAKE.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ask us about the full Joe Black Range</p>\r\n</div>\r\n</div>', 'Pure Wool Suiting', NULL, NULL, NULL, 'files/Brands/JOE_BLACK_LOGO_GZVKXay(1).jpg', 'files/page-banners/SuitHiretemplate.png', 35, 0, 0, 1, 'Joe Black Suits, Jo Black Suits Adelaide, Jo Black Clothing', 'Jo Black - Fine Men\'s Wear for any occasion', 1633091675, NULL, 1659583375, 5),
(175, 'Summit', 'summit', NULL, 71, NULL, NULL, '<p>The Summit Brand of men&#39;s wear avalible at Scott Ferguson formal wear, offers an affordable range of Cotton rich Shirts and slim fitting jackets and trousers.</p>', NULL, NULL, NULL, NULL, 'files/Brands/summit_black-label.jpg', 'files/page-banners/Banner-3.png', 39, 0, 0, 1, 'Suit Hire Adelaide, Men\'s Shirts, Cotton Shirts, Men\'s Wear,', 'Affordable men\'s wear, Suits, Shirts, Trousers and Jackets', 1632119123, NULL, 1664418540, 5),
(177, 'Gems and Jewellery', 'gems-and-jewellery', NULL, 64, NULL, NULL, '<p>We are proud supporters of Gems and Jewellery, If you are looking for&nbsp; high quality Australian Jewellery visit&nbsp;<a href=\"https://gemsandjewellery.com.au/\" target=\"_blank\">https://gemsandjewellery.com.au/</a> you wont find better prices.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'POA', 'https://gemsandjewellery.com.au/', 'https://gemsandjewellery.com.au/', NULL, 'files/Brands/G&JLOGO50x50.png', 'files/page-banners/WeddingRingbannerpsd.png', 200, 0, 0, 1, 'Gems and Jewellery', 'Gems and Jewellery great value high quality jewellery every day', 1654308185, NULL, 1654308311, 5),
