(56, 'Suit Hire near me,  Suit hire Adelaide south Australia, Suit hir Adelaide South, formal suit hire, School formal suit hire', 'Looking for a great suit hire package in Adelaide South Australia including shoes, Scott Ferguson formal-wear offers fantastic suit hire  options, including Wedding suit Hire, Black tie  dinner suit hire, School formal suit hire.', NULL, 'Suit Hire', 'suit-hire', 'files/page-banners/Banner-2suit.png', 'Suit Hire Adelaide', '<p>Suit Hire Adelaide South Australia</p>', 2, 1, NULL, 1630579066, 1, 1654585472, 5),
(57, 'Kilt hire, Kilt Hire Adelaide. Kilt Hire South Australia,Kilt  Hire Scott ferguson Formalwear, Prince Charlie kilt Hire', 'Looking to hire a Kilt Hire in Adelaide south Australia,  We have a great selection of hire kilts for weddings, birthdays, and formal functions. Scott Ferguson Formal-wear is offers Adelaide only professional kilt fitting service.', NULL, 'Kilt Hire', 'kilt-hire', 'files/page-banners/Banner-5.png', 'Wedding Kilt Hire', 'Kilt hire in Adelaide South Australia, Scott Ferguson Formal Wears bespoke tailored kilts add that special touch to formals, weddings, funerals and any time you want to stand out from the crowd. Our professional Kilt making service guarantees a great fitting kilt every time.', 2, 1, NULL, 1630579083, 1, 1654583822, 5),
(58, 'Slatters shoes, Dress Shoes, black Shoes, Dark Brown Shoes, Tan Shoes, Wedding Shoes near me', 'Stocking Slatters dress shoes, great quality dress shoes in Reynella south Australia. Slatters provide great quality Black, Brown and Tan leather shoes.', NULL, 'Slatters Shoes', 'slatters-shoes', 'files/page-banners/Shoeandcarsbanner.png', 'Slatters Shoes', 'Stocking Slatters dress shoes, great quality dress shoes in the south of Adelaide. Slatters shoes are comfortable and affordable we have a selection of great quality Black, Brown and Tan leather shoes.', 3, 1, NULL, 1630579096, 1, 1660110581, 5),
(61, 'Wedding Rings Adelaide, Celtic Wedding rings Adelaide, Peter W Beck Wedding rings', 'Scott Ferguson formal-wear has a selection of celtic and traditional wedding rings all made here in Adelaide.', NULL, 'Wedding Rings', 'wedding-rings', 'files/page-banners/WeddingRingbannerpsd.png', 'Wedding Rings', 'Scott Ferguson formal-wear has a selection of celtic and traditional wedding rings all made here in Adelaide. by Peter W Beck one of Australia\'s best wedding ring manufactures.', 3, 1, NULL, 1630585429, 1, 1654063728, 5),
(62, NULL, 'looking for children\'s suits to hire, Scott Ferguson can provide you with children\'s and boys suit right here in Adelaide.', NULL, 'Children Formal Wear', 'children-formal-wear', 'files/page-banners/Banner-3.png', 'Childrens and boys suit hire adelaide', 'We stock children\'s black suits and can provide a wide selection of boys suiting ages 12months to 16 years of age.\r\nHigh quality slim fitting suits both to hire and buy Black, Navy, Grey and charcoal suits plus if you need that something extra special we can supply you with fantastic high quality Tuxedos,  in a range of colors.', 3, 0, NULL, 1630585480, 1, 1659334757, 5),
