(67, 'mwn\'s watches, watches, watches Old reynella,  wedding gifts, graduation gifts, mens watches near me', 'Great value watches, looking for a great quality quarts action watch at very affordable prices, Watches make a great wedding gift for the groomsmen or the groom. Great graduation idea have your watch engraved.', NULL, 'Watches', 'watches', 'files/Gifts/Banner-6.png', 'Watches', 'Add a level of sophistication to your look with one of our great time pieces. We have a great selection of watches in store. They are an ideal gift for weddings,  graduations and birthdays.', 3, 0, NULL, 1633091501, 1, 1659401607, 5),
(68, NULL, NULL, NULL, 'Gibson', 'gibson', NULL, 'Gibson suits', NULL, 8, 1, NULL, 1633091505, 1, 1634619834, 5),
(69, 'Scottish Gifts, men\'s gifts, Sgain dubh, Wedding gifts, Quaichs, graduation gifts,', 'Great gift idea\'s for fathers day, weddings and Scottish gifts, like Highland Quaich, real wood and Deer antler Sgain dubhs and graduation gifts including Sunglasses fountain pens and whisky glasses.', NULL, 'Gift Idears', 'gift-idears', NULL, 'Gift Idea\'s', 'We have specially selected a range of gifts  that will make choosing the right gift for  Fathers day, the groom or groomsmen, weddings, and birthdays easy.  \r\n\r\nPolarized King 7 Sunglasses, Tankards and Goblets,  Men\'s  watches, Deer Antler and real wooded handle Sgain Dubhs, Highland Quaichs, clan badges, hip flasks and much more', 3, 1, NULL, 1633091512, 1, 1657775820, 5),
(70, 'men\'s Suits Adelaide, Quality men\'s Suits, Men\'s Suits Adelaide South', 'Quality Men\'s Wear Old Reynella  South Australia, Men\'s Suits, Shirts and jackets southern location servicing Marrion to Victor Harbor', NULL, 'Mens\'Wear', 'menswear', 'files/page-banners/Banner-3.png', 'Men\'s Wear', 'Quality Men\'s Wear Old Reynella  South Australia, Men\'s Suits, Shirts and jackets southern location servicing Marrion to Victor Harbor.', 8, 0, NULL, 1633091518, 1, 1660276292, 5),
(71, 'Cambridge clothing, Cambridge suits,', 'Cambridge Clothing -Premium menswear at Scott Ferguson Formalwear', NULL, 'Cambridge', 'cambridge', NULL, 'OldLace - Reduced 6thgeneration flexibility', '<div class=\"entry-content\">\r\n<p>INSPIRED BY TRADITION, TAILORED FOR TODAY.</p>\r\n\r\n<p>Established in Auckland, we started by making shirts for the early pioneers in 1867. Hard work, determination, and our clear-eyed ideals have overcome some of history&rsquo;s greatest obstacles. Today Cambridge is one of the leading men&rsquo;s tailored clothing specialists in New Zealand and Australia. 150 years in business and we&rsquo;re still thriving. Our family business is not just about family, it&rsquo;s about family values as applied to business.</p>\r\n\r\n<p>We&rsquo;re serious about what we do, determined to improve, keen to embrace new technology and we&rsquo;re in it for the long haul. In fact, 150 years so far. But we&rsquo;re acutely aware we could not have come this far without the talent and dedication of our co-workers and partners. A company can only succeed if everyone involved loves what they do, and customers want a piece of that magic.</p>\r\n</div>\r\n\r\n<p><a href=\"https://cambridgeclothing.com/\">https://cambridgeclothing.com/</a></p>', 8, 1, NULL, 1633091524, 1, 1634271519, 5),
(76, 'asdf', 'asdf', NULL, 'test things', 'test-things', 'files/1318.jpg', 'asdf', 'asdf', 3, 0, NULL, 1654251872, 1, 1654668635, NULL),
(78, NULL, NULL, NULL, 'Max', 'max', 'files/page-banners/Banner-2suit.png', 'Test', 'test', 2, 0, NULL, 1654583550, 5, 1659334081, NULL),
(81, 'Special Offers, Discounts,', 'Looking for a Great deal, Scott Ferguson Formal Wear  for limited times offers a range of Special Offers for your consideration.', NULL, 'Special Offers', 'special-offers', 'files/page-banners/Promotion.png', 'Special Offers', 'Looking for a Great deal, Scott Ferguson Formal Wear  on occasions and for  limited times, offers a range of Specials for your consideration.\r\n\r\nClick on our options below', 3, 1, NULL, 1665452162, 5, 1705459985, 5);
