INSERT INTO `contents` (`id`, `category_id`, `html_keyword`, `html_description`, `name`, `slug`, `short_description`, `description`, `status`, `created_at`, `created_by`, `updated_at`, `updated_by`) VALUES
(1, 1, 'Suit Hire Suit sales Adelaide, Kilt hire Kilt sales Adelaide', 'Adelaide\'s only Suit Hire and  Suit sales company that is also specialists in Kilt hire and Kilt sales located in Old Reynella South Australia.', 'Welcome to Scott ferguson Formal Wear', 'welcome-to-scott-ferguson-formal-wear', NULL, '<p><span style=\"font-size:14px\">Look no further for a great suit, fantastic fit for any occasion! Scott Ferguson Formal Wear offers a wide range of suits for sale or hire. Work, weddings or those all important corporate events. All this and more, at our easy to find store on the corner of South and Pimpala Roads, above Fasta Pasta.</span></p>\r\n\r\n<h2>Suit Hire:</h2>\r\n\r\n<p><span style=\"font-size:14px\">Suit hire Adelaide, from school formals to weddings, black tie and corporate events, Scott Ferguson Formal Wear offers a great range of suit hire packages. Serving Adelaide&rsquo;s southern area, from Victor Harbor to Marion, our quality hire suits will give you the sharp look you&rsquo;re after. Our premium suit hire fitting service will ensure your wedding suit hire experience is relaxed and comfortable.</span></p>\r\n\r\n<h2>Kilt Hire:</h2>\r\n\r\n<p><span style=\"font-size:14px\"><strong>A Touch of Scot &ndash; Our Specialist Kilt Hire:</strong></span></p>\r\n\r\n<p><span style=\"font-size:14px\">Scott Ferguson Formal wear Touch of Scot Kilt hire is second to none. Want to stand out in the crowd? Our bespoke tailored kilts add a special touch to any Formal,&nbsp; Weddings and&nbsp; Funerals</span></p>\r\n\r\n<p><span style=\"font-size:14px\">Our professional kilt making service ensures a perfect fit and includes: Scott Ferguson kilts are your statement of style and quality, are renowned throughout South Australia and highly sought after.</span></p>\r\n\r\n<h2>Special Service:</h2>\r\n\r\n<p><span style=\"font-size:14px\">Let us take the pain out of hiring a suit:</span></p>\r\n\r\n<p><span style=\"font-size:14px\">Can&rsquo;t find the right suit and need to hire it today?,We offer a SAME DAY Service! All we need is you to drop in and we will look after the rest!</span></p>\r\n\r\n<p><span style=\"font-size:14px\"><strong>We have a Formal Wear Emergency hot line &ndash; call before 6pm on 0412 336 763!</strong></span></p>\r\n\r\n<p>&nbsp;</p>', 1, 1526897286, 7, 1669350836, 7),
(7, 1, '', '', 'About Us', 'about-us', 'About Us', '<div class=\"row reverse\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"about__image\"><img alt=\"About Us\" src=\"../../../assets/uploaded/images/about-img.jpg\" /></div>\r\n</div>\r\n\r\n<div class=\"col-lg-6\">\r\n<div class=\"about__content\">\r\n<p>At Scott Ferguson Formal Wear we are passionate about continuing our Scottish formal wear business, while delivering exceptional quality suits and mens clothing to the wider southern area.</p>\r\n\r\n<p>We are one of the few Adelaide companies which can offer same day service on our suit and kilt hire service including alterations.</p>\r\n\r\n<p><strong>Tim Ferguson</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n<a class=\"btn btn-blue\" href=\"https://www.scottfergusonformalwear.com.au/lara/booking\">Book a free consultation</a></div>\r\n</div>\r\n</div>', 1, 1531757944, NULL, 1632371467, NULL),
(8, 3, NULL, 'Scott Ferguson Formal Wears Opening Hours', 'Suit Hire & Kilt Hire', 'suit-hire-kilt-hire', NULL, '<p>Sunday CLOSED</p>\r\n\r\n<p>Monday&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 10am - 4pm</p>\r\n\r\n<p>Tuesday&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 10am - 4pm<br />\r\nWednesday 10am - 6pm<br />\r\nThursday&nbsp;&nbsp;&nbsp;&nbsp; 10am - 5pm<br />\r\nFriday &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; 10am - 6pm<br />\r\nSaturday &nbsp; &nbsp; 10am - 2pm</p>\r\n\r\n<p>&nbsp;</p>', 1, 1630564855, NULL, 1700111576, NULL),
(10, 1, 'Booking', 'Booking', 'Booking', 'booking', 'booking', '<div class=\"col-md-12 col-sm-12 booking-form\"><iframe frameborder=\"0\" height=\"800px\" scrolling=\"no\" src=\"https://scottfergusonformalwear.com.au/dev/app/webroot/booking/index.php?calendar_id=34\" width=\"100%\"></iframe></div>', 1, 1631712067, NULL, 1660729034, NULL);
