(169, 'Cambridge Black Suit Hire', 'cambridge-black-suit-hire', NULL, 56, NULL, NULL, '<p>Always Look your best with a profecionaly fitted suit hire from Scott Ferguson Formalweaar.</p>\r\n\r\n<p>Be it your Wedding, black tie gala, school formal or any event that requires a premium formal Hire suit. Let us help you look fantastic with our high quality woolen Black Suit Hire psckage.</p>\r\n\r\n<ul>\r\n	<li>Complete Suit Hire packages $200</li>\r\n	<li>Our Black Suit Hire Package includes\r\n	<ul>\r\n		<li>Woolen Cambridge Suit</li>\r\n		<li>Pure cotton Shirt</li>\r\n		<li>Choice of Tie and Pocket Square</li>\r\n		<li>Black Leather Shoes form SLATTERS</li>\r\n	</ul>\r\n	</li>\r\n	<li>Open six days drop in any time or book an appointment <a href=\"tel:08 831 2716\">08 831 2716</a></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '200', NULL, NULL, 'https://www.facebook.com/scottfergusonformalwear', 'files/Suits/Black Suit Scott Ferguson Formalwear 1.jpg', 'files/page-banners/SuitHiretemplate.png', 10, 0, 0, 1, 'suit hire, suit hire Adelaide, suit hire south Australia, mens suit hire, formal wear, school formal, suits, formal suit hire', 'Suit hire in  Adelaide south Australia, for weddings, funerals, job interviews and school formals. Book an appointment and we will help you look your best.', 1630652360, NULL, 1659145193, 5),
(170, 'Formal Kilt Hire', 'formal-kilt-hire', NULL, 57, NULL, NULL, '<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<div class=\"content-info\">\r\n<p>Kilt Hire is our specialty. Scott Ferguson Formalwear offers Adelaide&#39;s only Kilt hire and fitting service. Stand out in the crowd with our kilt styles will give you the sharp look you&rsquo;re after to fit every occasion, and our premium fitting service will ensure your formahire experience is relaxed and comfortable.</p>\r\n\r\n<p>The Prince Charlie Kilt Package is a fantastic choice for any wedding or formal function. Hiding in this classic outfit is not an option, be proud and live life large.</p>\r\n\r\n<p>Package consists of</p>\r\n\r\n<ul>\r\n	<li>Pure wool Kilt</li>\r\n	<li>Prince Charlie Jacket and Waist coat</li>\r\n	<li>Choice of Shirt</li>\r\n	<li>Choice of Tie</li>\r\n	<li>Kilt Hose Black or Cream to keep</li>\r\n	<li>Sporran, Dress or Semi Dress</li>\r\n	<li>Belt and buckle</li>\r\n	<li>Tartan flashes</li>\r\n	<li>Ghillie brogues</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Black Watch, Hebridean Granite, Scotland the Brave, Scottish National, Irish national, Rangers F C, Dress Gordon, MacDonald Of Clanranald, MacLeoud of Harris Anc, Wedding Black, Flower Of Scotland, Royal Stewart, Black Stewart</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '285', NULL, NULL, NULL, 'files/kilts/Kilt Hire1.jpg', 'files/page-banners/Banner-5.png', 5, 0, 0, 1, 'Kilt Hire, Kilt Hire Adelaide, Kilt Hire South Australia, Scottish Kilt Hire', 'South Australia\'s  Kilt Hire Specialists, Looking to Hire a kilt package in Adelaide South Australia, Book now for your kilt fitting', 1632119123, NULL, 1659144384, 5),
(171, 'Cambridge Charcoal Suit', 'cambridge-charcoal-suit', NULL, 56, NULL, NULL, '<p>Modern Charcoal&nbsp; Suit package, look sophisticated with our professionally fitted suit hire from Scott Ferguson Formalwear.</p>\r\n\r\n<p>Be it your Wedding, Cocktail gala, school formal or any event that requires a premium hire suit let us help you look fantastic with one of our high quality woollen Charcoal suit Hire package.</p>\r\n\r\n<ul>\r\n	<li>Complete Suit Hire packages $200</li>\r\n	<li>Our Charcoal Suit Hire Package includes\r\n	<ul>\r\n		<li>Woollen Cambridge Suit</li>\r\n		<li>Pure cotton Shirt</li>\r\n		<li>Choice of Tie and Pocket Square</li>\r\n		<li>Leather Shoes form SLATTERS</li>\r\n	</ul>\r\n	</li>\r\n	<li>Open six days drop in any time or book an appointment <a href=\"tel:08 831 2716\">08 831 2716</a></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '200', NULL, NULL, 'https://www.facebook.com/scottfergusonformalwear', 'files/Suits/Charcoal_Suit Hire_ 42.jpg', 'files/page-banners/SuitHiretemplate.png', 15, 0, 0, 1, 'Suit Hire Adelaide, Suit Hire victor Habour, Suit Hire Marrion, Charcoal Suit Hire Package, Shop local suits', 'Charcoal Suit Hire Package, shop local from Marion to Victor harbor, we have a Charcoal suit for you.', 1634098361, NULL, 1641365650, 5),
(172, 'Cambridge Blue Suit Hire', 'cambridge-blue-suit-hire', NULL, 56, NULL, NULL, '<p>Stylish Blue Suit package, look your best with our professionally fitted suit hire from Scott Ferguson Formalwear.</p>\r\n\r\n<p>Be it your Wedding, Cocktail gala, school formal or any event that requires a premium hire suit. Let us help you look fantastic with one of our high quality woollen Bluel suit hire package.</p>\r\n\r\n<ul>\r\n	<li>Complete Suit Hire packages $200</li>\r\n	<li>Our Blue Suit Hire Package includes\r\n	<ul>\r\n		<li>Woollen Cambridge Suit</li>\r\n		<li>Pure cotton Shirt</li>\r\n		<li>Choice of Tie and Pocket Square</li>\r\n		<li>Leather Shoes form SLATTERS</li>\r\n	</ul>\r\n	</li>\r\n	<li>Open six days drop in any time or book an appointment <a href=\"tel:08 831 2716\">08 831 2716</a></li>\r\n</ul>', '200', NULL, NULL, 'https://www.facebook.com/scottfergusonformalwear', 'files/Suits/Blue_Suit Hire_ 32.jpg', NULL, 20, 0, 0, 1, 'Suit Hire Adelaide, Blue Suit Hire Adelaide, Modern Suit Hire Adelaide, Woollen Suit Hire Adelaide', 'Look Great with a Blue Suit Hire Package from Scott Ferguson Formalwear. Relax and enjoy our easy  fitting service', 1634099351, NULL, 1634099721, 5),
(173, 'Formal Suit Hire', 'formal-suit-hire', NULL, 56, NULL, NULL, '<p>Scott Ferguson Formalwear offers a Formal Suit package that&nbsp; is sophisticated and comfortable.</p>\r\n\r\n<p>Our professionally fitted suit hire service will make your Wedding Day , Black tie Gala, School Formal or any event that requires a premium Formal suit or tuxedo hire will be&nbsp; relaxed and affordable.</p>\r\n\r\n<p>Let us help you look fantastic with one of our high quality woollen Formal Dinner suit Hire package.</p>\r\n\r\n<ul>\r\n	<li>Complete Suit Hire packages $200</li>\r\n	<li>Our formal Suit Hire Package includes\r\n	<ul>\r\n		<li>Woollen Cambridge Suit</li>\r\n		<li>Pleated or Pure cotton Shirt</li>\r\n		<li>Choice of Bow tie</li>\r\n		<li>Leather Shoes form SLATTERS</li>\r\n	</ul>\r\n	</li>\r\n	<li>Open six days drop in any time or book an appointment <a href=\"tel:08 831 2716\">08 831 2716</a></li>\r\n</ul>', '200', NULL, NULL, 'https://www.facebook.com/scottfergusonformalwear', 'files/Suits/Formal_ Suit Hire_24.jpg', NULL, 25, 0, 0, 1, 'Suit Hire Adelaide, Tux Hire Adelaide, Formal Suit Hire Adelaide, School Formal Suit Hire Adelaide, Black tie Suit Hire Adelaide', 'Our Formal Dinner suit or tuxedo Suit Hire package is a perfect choice for your Wedding or Black tie Event.', 1634102169, NULL, 1634102169, NULL),
(174, 'Navy Suit Hire package', 'navy-suit-hire-package', NULL, 56, NULL, NULL, '<p>Navy Suit package, look your best with our professionally fitted suit hire from Scott Ferguson Formalwear.</p>\r\n\r\n<p>Be it your Wedding, Cocktail gala, school formal or any event that requires a premium hire suit. Let us help you look fantastic with one of our high quality woollen Navy suit hire package.</p>\r\n\r\n<ul>\r\n	<li>Complete Suit Hire packages $200</li>\r\n	<li>Our Navy Suit Hire Package includes\r\n	<ul>\r\n		<li>Premium Navy Suit</li>\r\n		<li>Pure cotton Shirt</li>\r\n		<li>Choice of Tie and Pocket Square</li>\r\n		<li>Leather Shoes form SLATTERS</li>\r\n	</ul>\r\n	</li>\r\n	<li>Open six days drop in any time or book an appointment <a href=\"tel:08 831 2716\">08 831 2716</a></li>\r\n</ul>', '200', NULL, NULL, 'https://www.facebook.com/scottfergusonformalwear', 'files/Suits/Navy Suit Hire1.jpg', NULL, 30, 0, 0, 1, 'Suit Hire Adelaide, Navy Suit Hire Adelaide, Navy Wedding Suit Hire, Dark Blue Suit Hire, Dark Blue Suit hire Adelaide', 'Slim Fit Navy and Dark Blue  wedding Suit Hire package Southern location', 1634104306, NULL, 1634104306, NULL),
(175, 'School Formal Hire Package', 'school-formal-hire-package', NULL, 56, NULL, NULL, '<p>Always look your best at your School formal, select from our full Hire range of Black, Charcoal, Navy, Blue suit&#39;s including our premium velvet tuxedo range, dont miss the chance to look sophisticated and charming at your school formal.</p>\r\n\r\n<p>Let us help you look fantastic with one of our high quality woollen Formal suit Hire package.</p>\r\n\r\n<ul>\r\n	<li>Complete Suit Hire packages $160</li>\r\n	<li>Our Suit Hire Package includes\r\n	<ul>\r\n		<li>Premium Cambridge Suit</li>\r\n		<li>Pleated or Pure cotton Shirt</li>\r\n		<li>Choice of Tie or Bow tie</li>\r\n		<li>Leather Shoes form SLATTERS</li>\r\n	</ul>\r\n	</li>\r\n	<li>Choose from one of our Premium Vlevet School formal options and be the best dressed.\r\n	<ul>\r\n		<li>Burgandy velvet, Navy velvet and Silver velvet jackets,</li>\r\n	</ul>\r\n	</li>\r\n	<li>Open six days drop in any time or book an appointment <a href=\"tel:08 831 2716\">08 831 2716</a></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"https://www.scottfergusonformalwear.com.au/product/school-formal-hire-deal\"><span style=\"color:#FF0000\"><span style=\"font-family:georgia,serif\"><em><strong>Looking for a special deal</strong></em></span></span></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '160', NULL, NULL, 'https://www.facebook.com/scottfergusonformalwear', 'files/Suits/Formal2021.JPG', NULL, 30, 0, 0, 1, 'School Formal Hire, School formal Suit Hire, Formal hire Adelaide, School Formal Hire Adelaide', 'Look great at your school formal with our range of suit hire option, easy to find southern location', 1634105613, NULL, 1705464959, 5),
(176, 'Basic Kilt Hire', 'basic-kilt-hire', NULL, 57, NULL, NULL, '<p>If you need a kilt outfit but dont want the formal Prince charlie Kilt outfit, we sugest you look at our Basic Kilt Hire package. This is a great option for a non formal occasion, consisting of</p>\r\n\r\n<ul>\r\n	<li>Pure Wool Kilt</li>\r\n	<li>Belt and Buckle</li>\r\n	<li>Sporran, Semi Dress or Dress Sporran</li>\r\n	<li>Kilt Pin</li>\r\n	<li>Kilt Hose (new to keep Black or Cream)</li>\r\n	<li>Flashes</li>\r\n	<li>Ghillie Brogues</li>\r\n</ul>\r\n\r\n<p>Our Tartan Selection</p>\r\n\r\n<p>Black Watch, Hebridean Granite, Scotland the Brave, Scottish National, Irish national, Rangers F C, Dress Gordon, MacDonald Of Clanranald, MacLeoud of Harris Anc, Wedding Black, Flower Of Scotland.</p>', '220', NULL, NULL, NULL, 'files/kilts/Basic kilt outfit.jpg', 'files/page-banners/Banner-5.png', 8, 0, 0, 1, 'Basik Kilt hire, Kilt Hire Adelaide, kilt Hire South Australia, Kilt Hiree Scott Ferguson Formalwear', 'Get your Kilt on, Kilt Hire in Adelaide South Australia from Scott Ferguson Formal-wear', 1643075814, NULL, 1653445471, 5),
(177, 'Premium School Formal Hire', 'premium-school-formal-hire', NULL, 56, NULL, NULL, '<p>Look Spectacular&nbsp; at your School formal, select from our&nbsp; range of Burgandy, Silver or Navy&nbsp; Blue velvet suit&#39;s , dont miss the chance to look sophisticated and charming at your school formal.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Let us help you look fantastic with one of our high quality Formal suit Hire package.</p>\r\n\r\n<ul>\r\n	<li>Complete Suit Hire packages $200</li>\r\n	<li>Our Suit Hire Package includes\r\n	<ul>\r\n		<li>Premium Burgandy, Silver or Navy Blue Velvet jacket</li>\r\n		<li>Pleated or Pure cotton Shirt</li>\r\n		<li>Choice of Tie or Bow tie</li>\r\n		<li>Leather Shoes form SLATTERS</li>\r\n	</ul>\r\n	</li>\r\n	<li>Open six days drop in any time or book an appointment <a href=\"tel:08 831 2716\">08 831 2716</a></li>\r\n</ul>\r\n\r\n<p style=\"text-align:center\"><strong>LIMMITED AVALIBILITY FIRST IN BEST DRESSED</strong></p>', '200', NULL, NULL, NULL, 'files/Suits/Silver Velvet jacket Hire 2.jpg', 'files/page-banners/SuitHiretemplate.png', 77, 0, 0, 1, 'Velvet Suit hire, Suit hire Adelaide, School formal suit hire, School formal Suit Hire Reynella', 'Premium velvet suit hire option at Scott Ferguson Formalwear', 1644890139, NULL, 1646010801, 5),
(178, 'Argyle kilt Hire', 'argyle-kilt-hire', NULL, 57, NULL, NULL, '<p>The Argyle Kilt Hire Package is a less formal option than our traditional prince Charlie kilt Package.This Package features a Pure wool jacket and 5 button waist coat manufactured in Scotland, this is a distinctly Scottish look.</p>\r\n\r\n<p>Scott Ferguson Argyle Kilt Package</p>\r\n\r\n<ul>\r\n	<li>Pure Wool Argyle jacket and Waist coat (Black)</li>\r\n	<li>Pure wool Kilt</li>\r\n	<li>100% cotton Shirt</li>\r\n	<li>Tie, Cravatte or Bow tie</li>\r\n	<li>Semi dress Sporran</li>\r\n	<li>Kilt pin</li>\r\n	<li>Kilt Hose ( Black or Cream to keep)</li>\r\n	<li>Ghillie Brogues size 6 to 14 UK sizes</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Black Watch, Hebridean Granite, Scotland the Brave, Scottish National, Irish national, Rangers F C, Dress Gordon, MacDonald Of Clanranald, MacLeoud of Harris Anc, Wedding Black, Flower Of Scotland.</p>', '285', NULL, NULL, NULL, 'files/kilts/Argyle Kilt Outfit.jpg', 'files/page-banners/Kilt Hire Adelaide.jpeg', 6, 0, 0, 1, 'Kilt hire, Kilt Hire Adelaide. Kilt Hire South Australia, Kilt  Hire Scott ferguson Formalwear, Argyle kilt Hire Adelaide South Australia', 'Scott Ferguson Formal-wear offers  Argyle Kilt Hire Package in Adelaide South Australia. Stand out from the crowd in a kilt Hire package from Scott Ferguson Formal-wear.', 1653444459, NULL, 1653446376, 5),
(179, 'Childrens Kilt Hire', 'childrens-kilt-hire', NULL, 57, NULL, NULL, '<p>Scott Ferguson Formal-wear offers a wee mans selection of kilt Hire outfits that match our full kilt hire packages.</p>\r\n\r\n<p>Children look adoringly cute in a kilt, ask us about our Children&#39;s kilt Hire packages</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Childs Kilt</li>\r\n	<li>Prince Charlie Jacket</li>\r\n	<li>Shirt</li>\r\n	<li>Bow tie</li>\r\n	<li>Sporrans and Belts</li>\r\n	<li>Kilt Pin</li>\r\n	<li>Hose ( cream only)</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>While we do have kilts that will fit from 12 months&nbsp; not all tartans are avalible we do not offer childrens brouges to hire.</p>', '160', NULL, NULL, NULL, 'files/kilts/Child\'s kilt outfit.jpg', 'files/page-banners/Kilt Hire Adelaide.jpeg', 7, 0, 0, 1, 'Childrens Kilt Hire, Childrens Kilt Hire Adelaide South Australia', 'Children\'s kilt Hire packages in Adelaide South Australia by Scott Ferguson Formal Wear.', 1653446728, NULL, 1653447035, 5),
(180, 'Childrens Suit Hire', 'childrens-suit-hire', NULL, 56, NULL, NULL, '<p>Slim Fit Children&#39;s 5 piece Suit Hire packages available in Black and Dark Blue, If you would like hire a suit for your child&nbsp; look no further we offer a selection of Children&#39;s suiting to hire or purchase.</p>\r\n\r\n<p>5 piece Suit Hire Package</p>\r\n\r\n<ul>\r\n	<li>Suit Jacket</li>\r\n	<li>Suit Trouser</li>\r\n	<li>Matching Waistcoat</li>\r\n	<li>White Shirt</li>\r\n	<li>Tie or Bow tie</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '160', NULL, NULL, NULL, 'files/Suits/Children\'s suit hire.jpg', 'files/page-banners/SuitHiretemplate.png', 88, 0, 0, 1, 'Childrens Suit Hire, Childrens Suit Hire Adelaide South Australia, Childrens black Suit Hire, Childrens Dark Blue Suit hire', 'Children\'s Suits for Hire and to buy, Children\'s Suit hire Adelaide South Australia, Child\'s Black Suit Hire', 1653455937, NULL, 1653456448, 5),
(181, 'Highlander Outfit', 'highlander-outfit', NULL, 57, NULL, NULL, '<p>If you need a kilt outfit but dont want the formal Prince charlie Kilt outfit, we sugest you look at our Highlander Kilt Hire package. This is a great option for a non formal occasion, consisting of</p>\r\n\r\n<ul>\r\n	<li>Pure Wool Kilt</li>\r\n	<li>Kilt Shirt, off white or Black</li>\r\n	<li>Belt and Buckle</li>\r\n	<li>Sporran, Semi Dress or Dress Sporran</li>\r\n	<li>Kilt Pin</li>\r\n	<li>Kilt Hose (new to keep Black or Cream)</li>\r\n	<li>Flashes</li>\r\n	<li>Ghillie Brogues</li>\r\n</ul>\r\n\r\n<p>Our Tartan Selection</p>\r\n\r\n<p>Black Watch, Hebridean Granite, Scotland the Brave, Scottish National, Irish national, Rangers F C, Dress Gordon, MacDonald Of Clanranald, MacLeoud of Harris Anc, Wedding Black, Flower Of Scotland.</p>', '240', NULL, NULL, NULL, 'files/kilts/Kilt_shirt_outfit.jpg', 'files/page-banners/Kilt Hire Adelaide.jpeg', 50, 0, 0, 1, 'Kilt hire, Kilt Hire Adelaide. Kilt Hire South Australia, Kilt  Hire Scott ferguson Formalwear,  kilt Hire Adelaide South Australia, kilt hire near me', 'Like to wear a kilt outfit to the next wedding you are attending, we have great kilt outfits right here in Adelaide', 1660268179, NULL, 1660274439, 5);
