(38, 'Carlos Pablo', '695 ranger drive', 'cp007424@gmail.com', '4805355682', NULL, 'Dear Sir,\r\nWe are Savelanded Global Link Limited  in China & JAPAN. We are into different types of Textile machinery and Industrial sewing machines both New and used and made in Japan and other quality brands.\r\n\r\nWe have available Textile Machinery for Weaving, Knitting, warp knitting ,non woven machinery, Yarn manufacturing, textile laboratory ,Dyeing machines, Printing and engraving machinery, Rope and Braiding Machineries, Leather Machinery\r\n\r\nAlso, we have Industrial sewing machines such as JUKI, Brother, Siruba, Janome, Singer and many more.\r\n\r\nLet us know what you are looking for\r\n\r\nRegard\r\n\r\n\r\n+813756 5997 9\r\n+813556 5604 0', '197.211.63.97', 'Mozilla/5.0 (Linux; Android 10; K) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/117.0.0.0 Mobile Safari/537.36', '2023-10-24 05:15:01', '2023-10-24 05:15:01'),
