INSERT INTO `retails` (`id`, `name`, `slug`, `type`, `category_id`, `location_id`, `short_description`, `long_description`, `price`, `pinterest`, `twitter`, `facebook`, `cover_image`, `banner_image`, `acc_ordering`, `popular`, `featured`, `status`, `html_keyword`, `html_description`, `created_at`, `created_by`, `updated_at`, `updated_by`) VALUES
(170, 'Ladies Kilt', 'ladies-kilt', NULL, 8, NULL, NULL, '<p>ladies Kilts</p>\r\n\r\n<p>Our ladies&#39; kilted Skirts are custom made from lightweight 9 - 10oz.tartan fabric.</p>\r\n\r\n<p>Our traditional kilted skirt features a flat apron at the front has 3/4 inch pleating depth at the back creating flowing movement and swing.</p>\r\n\r\n<p>Find your perfect fit in a tartan of your choice! with over 500 tartans to choose from</p>\r\n\r\n<p>Featuring two buckled straps at one side, and one buckled strap on the inside, incorporate this elegant and stylish piece into your wardrobe.This is a classic design that every woman should have.</p>\r\n\r\n<p>Visit us in store for a fitting allow 6 weeks to make so order in Autumn for a stylish kilted skirt for winter.</p>', '399', NULL, NULL, NULL, 'files/kilts/Ladies Kilt Hero.png', 'files/page-banners/Kilt Hire Adelaide.jpeg', 22, 0, 0, 1, 'Ladies Kilted  Skirt, Ladies Kilt, Made to  measure kilt, Kilted Skirt Adelaide South Australia', 'Ladies Kilts, made to  measure kilt in Scotland, Kilted Skirt Adelaide South Australia', 1630657599, NULL, 1654659457, 5),
(171, 'Great Value Suits', 'great-value-suits', NULL, 10, NULL, NULL, '<p style=\"text-align:center\">Great Value Suits</p>\r\n\r\n<p>We have a selection of great quality budget suits avalible in store</p>\r\n\r\n<ul>\r\n	<li><strong>Classic Fit Suits</strong>&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp; medim lapel full bodied and a great fit for the bigger guy trouserd are fuller.</li>\r\n	<li><strong>Europian Fit Suits &nbsp; -&nbsp;</strong> Fitted body&nbsp; and tapered fit trousers a great allround choice</li>\r\n	<li>Half lined trousers in store hemming avalible</li>\r\n</ul>\r\n\r\n<p><strong>Fabricks</strong></p>\r\n\r\n<p>Wool blend &amp; High Quality Polly Vicose</p>\r\n\r\n<p><strong>Colours</strong></p>\r\n\r\n<p>Black, Dark Blue Navy&nbsp; and Charcoal,</p>\r\n\r\n<p style=\"text-align:center\"><strong><em>Shop local, Shop South, Shop Scott Ferguson Formalwear</em></strong></p>', '299', NULL, NULL, NULL, 'files/Suits/Navy Suit Hire_3.jpg', 'files/page-banners/Banner-2suit.png', 11, 0, 0, 1, 'Great Value Suits, Budget suits, Men\'s Suits Adelaide, Quality men\'s Suits, Men\'s Suits Adelaide South', 'Men\'s Budget suits in Adelaide, Reynella, Woodcroft, Morphet Vale, Seaford, Norlunga and  suits near me. easy to find southern location Main south road Old Reynella. Shop local, Shop South, Shop Scott Ferguson Formalwear', 1630657599, NULL, 1660352782, 5),
(174, 'Highland Quaich', 'highland-quaich', NULL, 69, NULL, NULL, '<h3>4&quot; Diameter Highland Quaich or Friendship Cup</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Traditional Highland Quaichs made in Scotland make a perfict Wedding gift. We have both Celtic Pattern Quaichs and Plain quaichs if you would like to add engraving for a more personalized gift.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The word QUAICH come from the Gaelic word Cuach, meaning shallow cup</p>\r\n\r\n<p>Traditionally offered to a guest as a cup of welcome and again as a offering of farewell.</p>\r\n\r\n<p>Today it is often used in Wedding ceremonies and or at wedding receptions as a part of the ritual sharing of the water of life the Scotch Whiskey.</p>\r\n\r\n<p>This is a fabulous unique gift anyway you look at it.</p>', '120', NULL, NULL, NULL, 'files/Gifts/Celtic Quaich_hero.png', 'files/page-banners/Kilt Hire Adelaide.jpeg', 22, 0, 0, 1, 'Scottish Gifts, men\'s gifts, Wedding gifts, Highland Quaich, Quaich, Scottish Quaich Adelaide, 4:\" Quaich, Celtic Quaich Adelaide', 'High quality Scottish Highland Quaich 4\" in stock, Looking for a Scottish gift we have highland Wedding  Quaich\'s in Adelaide South Australia, stocking plain Quaich and Celtic Pattern Quaichs made in Scotland.', 1630657599, NULL, 1659417511, 5),
(176, 'Watches', 'watches', NULL, 69, NULL, NULL, '<p>We have a great selection of watches in store. They are an ideal gift for weddings, graduations and birthdays</p>', '118', NULL, NULL, NULL, 'files/Gifts/Group1.jpg', 'files/Gifts/Banner-6.png', 111, 0, 0, 1, 'mwn\'s watches, watches, watches Old reynella, Wedding Gifts, Groom Gifts, Graduation gifts', 'Men\'s watches Old Reynella South Australia, Watches make a great wedding or graduation gift,', 1631763042, NULL, 1659401594, 5),
(178, 'Wedding Rings', 'wedding-rings', NULL, 61, NULL, NULL, '<p>We are not just a menswear company we have been selling Australian made and designed wedding rings for over 15 years.</p>\r\n\r\n<p>We can have your special ring crafted in Gold, Platinum, Palladium, Titanium, or Stirling silver.</p>\r\n\r\n<p>Ask us for a quote or see our display&nbsp; of wedding bands avalible in his and her sets, all in the one southern location</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>Shop local, Shop South, Shop Scott Ferguson Formalwear</em></strong></p>', 'Get a Quote', NULL, NULL, NULL, 'files/Wedding Rings Hero.png', 'files/page-banners/WeddingRingbannerpsd.png', 60, 0, 0, 1, 'Wedding Rings Adelaide, Celtic Wedding rings Adelaide', 'Classic and celtic Wedding rings southern location Adelaide South Australia Shop local, Shop South, Shop Scott Ferguson Formal wear', 1641363377, NULL, 1654585320, 5),
(179, 'Tweed Jackets and Waistcoats', 'tweed-jackets-and-waistcoats', NULL, 8, NULL, NULL, '<p><br />\r\nTweed Jackets and Waistcoats</p>\r\n\r\n<p>Scott Ferguson formal-wear offers a range of Tweed jacket in a variety of styles from Argyle to the Clunie and Crail Jackets all with 5 button Waistcoat, made from 100% Pure New Wool herringbone and standard tweed fabric. Single button featuring Prince Charlie or Argyle cuffs, plaited epaulettes and high-neck waistcoat, both trimmed with imitation staghorn buttons.</p>\r\n\r\n<p>This is a perfect choice jacket for Weddings, day wear or non formal evening events.</p>\r\n\r\n<p>Visit us in store for a fitting&nbsp; Size range 36&quot; to 54&quot;</p>\r\n\r\n<p>Charcoal</p>\r\n\r\n<p>Moss</p>\r\n\r\n<p>Lovate Blue</p>\r\n\r\n<p>Midnight Blue</p>\r\n\r\n<p>Peat</p>\r\n\r\n<p>Graphite</p>\r\n\r\n<p>Limited stock so please allow 4 weeks for delivery</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '699', NULL, NULL, NULL, 'files/kilts/Crail Graphite.png', 'files/page-banners/Kilt Hire Adelaide.jpeg', 15, 0, 0, 1, 'Tweed Jacket Adelaide South Australia, Crail Tweed Jacket, Clunie Tweed Jacket, Argyle Tweed Jacket', 'Tweed jackets in Adelaide South Australia sourced  from Scotland, Our Crail, Clunie and Argyle tweed jacket are made to he highest standard pure wool tweed jacket from Scott Ferguson formal-wear', 1654231540, NULL, 1654659640, 5),
(180, 'Slim fit Suits', 'slim-fit-suits', NULL, 10, NULL, NULL, '<p style=\"text-align:center\">UBERSTONE&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; GIBSON</p>\r\n\r\n<p>Looking for a modern fitted suit, one that highlites your physice. Scott ferguson have a specialy selected range of Skinny and Slim fit suits from GIBSON and UBERSTONE.</p>\r\n\r\n<p>Pure wool 50% wool and cotten linen mix suits for the man who knows his style.</p>\r\n\r\n<p>Black</p>\r\n\r\n<p>Charcoal</p>\r\n\r\n<p>Airforce Blue</p>\r\n\r\n<p>Silver Grey</p>\r\n\r\n<p>Sand</p>\r\n\r\n<p>Visit us instore for a fitting</p>', 'From 399', NULL, NULL, NULL, 'files/Suits/Blue_Suit Hire_ 31.jpg', 'files/page-banners/Banner-3.png', 33, 0, 0, 1, 'slim fit Suits Adelaide South Australia, woolen suits adelaide,great value suits adelaide', 'looking for great quality slim and skinny fit suits in Adelaide South Australia, Scott Ferguson Formal-wear offer slim fit suits from Uberstone and Gibson.High quality men\'s suits at great prices.', 1654240961, NULL, 1659508984, 5),
(181, 'test menu add item in menu top side', 'test-menu-add-item-in-menu-top-side', NULL, 10, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'files/kilts/Dress Rangers.jpg', 'files/kilts/Hebridiean Granit.jpg', 11, 0, 0, 0, NULL, NULL, 1654249330, NULL, 1654249464, NULL),
(182, 'Kilts', 'kilts', NULL, 8, NULL, NULL, '<p>Adelaide&#39;s only Kilt shop, we specialise in providing beautifully crafted made to measure kilts. Scott Ferguson Formalwear&rsquo;s bespoke tailored kilts add that special touch to formals, weddings, funerals and any time you want to stand out from the crowd. Made locally and in Scotland with 100% new wool from Scotland&rsquo;s finest tartan mills, Scott Ferguson Formalwear&rsquo;s kilts are highly sought after and renowned in South Australia.</p>\r\n\r\n<ul>\r\n	<li>&nbsp;&nbsp;&nbsp; Traditional 8 &amp; 9 Yard Kilts</li>\r\n	<li>&nbsp;&nbsp;&nbsp; Day Kilts 5 yard&nbsp;</li>\r\n	<li>&nbsp;&nbsp;&nbsp; Kilts are made from 100% new wool milled and woven in Scotland</li>\r\n	<li>&nbsp;&nbsp;&nbsp; Over 500 Tartans to choose from</li>\r\n	<li>&nbsp;&nbsp;&nbsp; Old world Great Kilts</li>\r\n	<li>&nbsp;&nbsp;&nbsp; Professional measure and fitting service</li>\r\n	<li>&nbsp;&nbsp;&nbsp; Kilt Alterations</li>\r\n</ul>\r\n\r\n<p>If you a looking to own your very own kilt drop in and have a chat we will help you through the process</p>', NULL, NULL, NULL, NULL, 'files/kilt.jpg', 'files/page-banners/Kilt Hire Adelaide.jpeg', 10, 0, 0, 1, 'kilt in Adelaide south Australia, Traditional kilt, 8 yard kilt, great kilt, day kilt, 9 yard kilt, men\'s kilts, made to measure kilts, kilts near me', 'Traditional 8 or 9 yard kilts made to measure, Kilt fitting in Adelaide South Australia, Adelaide\'s only kilt shop always have a professional fitting dot leave it to chance on your new kilt.', 1654492712, NULL, 1659334411, 5),
(183, 'Ladies Kilted Hostess Skirt', 'ladies-kilted-hostess-skirt', NULL, 8, NULL, NULL, '<p>Ladies Tartan Kilted Long Hostess Skirts,</p>\r\n\r\n<p>All our ladies tartan kilted skirts are made in Scotland from 100% pure wool. Our Full-length Hostess Kilted Skirts are custom made from lightweight 9-10 oz.tartan fabric. Hand pleated at the back allowing it to hang beautifully and a flat front apron.</p>\r\n\r\n<p>Choose from over 500 tartans This elegant hostess kilt features two buckled straps at one side, and one buckled strap on the inside.</p>\r\n\r\n<p>Visit us instore for a fitting.</p>\r\n\r\n<p>&nbsp;</p>', '505', NULL, NULL, NULL, 'files/kilts/Hostes hero.png', 'files/page-banners/Kilt Hire Adelaide.jpeg', 20, 0, 0, 1, 'Ladies Kilted Long Hostess Skirt, Ladies Kilt, tartan skirt, Made to  measure kilt, Kilted Skirt Adelaide South Australia', 'Made to measure Hostess Kilted Tartan Skirt, pure wool woven and made in Scotland, Traditional Hostess  kilted tartan skirts in Adelaide South Australia.', 1654654822, NULL, 1654667407, 5),
(184, 'Mini Kilts', 'mini-kilts', NULL, 8, NULL, NULL, '<p>Mini Kilts</p>\r\n\r\n<p>Our ladies&#39; Mini skirts are custom made from lightweight ( 9-10 oz.) pure wool tartan fabric. This lovely kilted skirt has extra deep hand pleating at the back, creating movement and swing of a kilt.</p>\r\n\r\n<p>Find your perfect fit in a tartan of your choice! with over 500 tartans to choose from, Our mini Kilts feature two buckled straps at one side, and one buckled strap on the inside, This is a must to incorporate this elegant and stylish piece into your wardrobe.</p>\r\n\r\n<p>Made to measure only allow 6 weeks to make.</p>', '350', NULL, NULL, NULL, 'files/kilts/Mini kilt.png', 'files/page-banners/Kilt Hire Adelaide.jpeg', 40, 0, 0, 1, 'Ladies mini Kilt , Ladies Kilt, tartan mini skirt, Made to  measure mini kilt, Kilted Skirt Adelaide South Australia', 'Wear our Ladies mini Kilt , Ladies Kilts and tartan mini skirt over 500 tartans to chose from, Made to  measure mini kilt, Kilted mini Skirt in  Adelaide South Australia', 1654666449, NULL, 1654667981, 5),
(185, 'Tartan Waist Coat', 'tartan-waist-coat', NULL, 8, NULL, NULL, '<p>Our&nbsp; Men&#39;s Tartan Waistcoat are made from either 10 or 13 oz light to medium weight tartan fabric, they are fully lined either made here in Adelaide or in Scotland.</p>\r\n\r\n<p>They come with the following features:</p>\r\n\r\n<ul>\r\n	<li>100% Pure New Wool</li>\r\n	<li>Black Satin Type Lining</li>\r\n	<li>5 Button Imitation Stag Horn Closure</li>\r\n	<li>2 Side Pockets</li>\r\n	<li>Adjustable Strap on the Back</li>\r\n	<li>Dry Clean Only</li>\r\n	<li>Made to measure in over 500 Tartans</li>\r\n</ul>\r\n\r\n<p>Allow 5 to 8 weeks as these are a made to measure item</p>', '280', NULL, NULL, NULL, 'files/kilts/Tartan Waistcoat hero..png', 'files/page-banners/Kilt Hire Adelaide.jpeg', 16, 0, 0, 1, 'Tartan Waist Coat, made to measure tartan waistcoat, tartan waistcoats in Adelaide South Australia', 'Looking for Tartan Waist Coat,  we make to measure tartan waistcoat, tartan waistcoats in Adelaide South Australia, over 500 tartans to chose from.', 1654671960, NULL, 1663138754, 5),
(186, 'Business Suits', 'business-suits', NULL, 10, NULL, NULL, '<p>Our Classic timeless 50% wool business suits are a great choice for the daily wear.</p>\r\n\r\n<p>The modern fit Hardwick Jacket matched with Jett trousers is a versatile and comfortable suit for any occasion.</p>\r\n\r\n<p>Available in Black, Charcoal and Navy</p>\r\n\r\n<p>Jacket and trousers are available as separate items tailored to your fit.</p>\r\n\r\n<p><strong>Hardwick Jacket 88cm to 136cm</strong></p>\r\n\r\n<ul>\r\n	<li>Cloth: 52% Wool 48% Polyester</li>\r\n	<li>Notch lapel</li>\r\n	<li>Two button front</li>\r\n	<li>Straight flap pockets</li>\r\n	<li>Side vents</li>\r\n	<li>Fully Lined</li>\r\n</ul>\r\n\r\n<p><strong>Jett Trousers 76cm to 132cm</strong></p>\r\n\r\n<p>Featuring Comfort waist band that will flex and stretch one size providing a extremely comfortable trouser fit</p>\r\n\r\n<p>These suits are versatil and hard wearing, while the jacket is dry cleaning only the trousers are machine washable providing flexability when dry cleaning isnt a option.</p>', '399', NULL, NULL, NULL, 'files/Suits/Charcoal_Suit Hire_40.jpg', 'files/page-banners/Banner-3.png', 9, 0, 0, 1, NULL, NULL, 1654676380, NULL, 1659147206, 5),
(187, 'Sgain Dubh', 'sgain-dubh', NULL, 69, NULL, NULL, '<h3>Sgain Dubh</h3>\r\n\r\n<p>The Sgain Dubh, is the Gaelic word for Black Blade, the word Sgain represents a small blade or knife no longer than a foot in length typically smaller, and the the word Dubh represents Black hence the over all translation of Black Blade.</p>\r\n\r\n<p>Scott Ferguson Formal-wear offers a selection of hand made Scottish Sgain Dubh&#39;s in stock now in Adelaide. If you are looking for a real sgain dubh we have them. Deer Antler, Black wood and other solid real wood handle Sgain Dubhs, safe sgain dubh.</p>\r\n\r\n<p>We have a section of Scottish hand crafted Sgain Dubh&#39;s featuring real Deer Antler, Black wood or other Native Scottish tree woods. If you are looking for a real Sgain Dubh we have them.</p>\r\n\r\n<p><br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, 'files/Gifts/Blackwood Sgain Dubh.png', 'files/page-banners/Banner-SGAIN DUBH1.png', 10, 0, 0, 1, 'Scottish Gifts, Sgain dubh adelaide, Deer Antler Sgain Dubh adelaide, Black wood Sgain Dubh, wooden handled Sgain dubh, scaid dubh adelaide South  Australia', 'Great Scottish Gifts, select from our range of hand crafted Scottish made Sgain dubh, Deer Antler Sgain Dubh, Black wood Sgain Dubh, wooden handled Sgain dubh in stock now in Adelaide', 1657781110, NULL, 1670889450, 5),
(188, 'Premium Wool Suits', 'premium-wool-suits', NULL, 10, NULL, NULL, '<p>Premium pure wool suits superior 100s</p>\r\n\r\n<p>If you enjoy wearing quality clothing we offer a selection of premium pure wool suits from Cambridge.</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, NULL, NULL, 'files/Suits/Cambridge pure wool suit.png', 'files/page-banners/Banner-2suit.png', 40, 0, 0, 0, 'Pure wool Suits Adelaide South Australia, permium woolen suits adelaide, great value suits adelaide', 'Pure wool suits at great prices, Premium pure wool suits in the south of Adelaide, Quality premium suits at Scott Ferguson Formal wear', 1659331254, NULL, 1663741274, 5),
(189, 'Tartan Scarves Ties & Sashes', 'tartan-scarves-ties-sashes', NULL, 8, NULL, NULL, '<p>We source tartan and scottish made products direct from Scottlands finest tartan mills, With access to over 500 tartans we will be able to help you source you clan tartan.</p>\r\n\r\n<p>Products we can supply</p>\r\n\r\n<ul>\r\n	<li>Tartan Bow Ties $50</li>\r\n	<li>Tartan Ties $50</li>\r\n	<li>Tartan Scarves $55</li>\r\n	<li>Tartan Full Sashes $110</li>\r\n	<li>Tartan mini sashes $55</li>\r\n	<li>Tartan golf hats $80</li>\r\n	<li>Tartan Tams $80</li>\r\n	<li>Tartan Blankets $210</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ask us how we can help you source you clan accessories</p>', NULL, NULL, NULL, NULL, 'files/kilts/Scarf and Tam.png', 'files/page-banners/Kilt Hire Adelaide.jpeg', 80, 0, 0, 1, 'Tartan Ties, tartasn Sashes, Tartan Scarves, Tartan,', 'High Quality pure wool Scarves, Tartan Ties, Tartan Sashes  and Tartan scarves made in Scotland available in Adelaide', 1659498708, NULL, 1659581062, 5),
(190, 'Dress Shoes', 'dress-shoes', NULL, 58, NULL, NULL, '<p>We have a selection of great value leather dress shoes from Slatters.</p>\r\n\r\n<p>All our shoes are comfterble and great value. If you are looking to finish off your outfit with a fantastic shoe from Slatters ask us how we can help.</p>\r\n\r\n<p>Our Slatters shoes selection&nbsp; Black, High Shine in Black, Dark Brown and Tan</p>\r\n\r\n<p><strong>&bull; Leather Upper</strong><br />\r\n<strong>&bull; Leather Lining</strong><br />\r\n<strong>&bull; Leather Insole</strong><br />\r\n<strong>&bull; Synthetic Sole</strong></p>\r\n\r\n<p>Sizes 6 to 13</p>\r\n\r\n<p>Half Sizes 7.5 to 10.5</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table cellspacing=\"0\" class=\"variations\" style=\"height:1px; width:2px\">\r\n	<tbody>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', 'From $98', NULL, NULL, NULL, 'files/Slatters/Sting.png', 'files/page-banners/Shoeandcarsbanner.png', 90, 0, 0, 1, 'Adelaide shoes, black dress shoes, slatters shoes, shoes near me', 'Great quality dress shoes in Adelaide from SLATTERS, We have a selection of dress shoes to complement your new Wedding suit.', 1660115340, NULL, 1663741766, 5),
(191, 'Suit Package\'s', 'suit-packages', NULL, 10, NULL, NULL, '<h3><strong>STARTER $420</strong></h3>\r\n\r\n<p>Our Starter Suit Package is ideal for someone who needs a no frills, tried and tested this works for me suit package.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp; Modern Suit<br />\r\n&nbsp;&nbsp;&nbsp; Cotton Rich Shirt<br />\r\n&nbsp;&nbsp;&nbsp; Tie and Hank Set<br />\r\n&nbsp;&nbsp;&nbsp; Socks<br />\r\n&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<h3><strong>LOOKING THE PART $570</strong></h3>\r\n\r\n<p>This awesome suit package if perfect for the daily grind or daily commute, if you wear your suit more than 3 times a year this outfit is for you</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp; Wool Blend Suit<br />\r\n&nbsp;&nbsp;&nbsp; Pure Cotton Shirt<br />\r\n&nbsp;&nbsp;&nbsp; Tie and Hank Set<br />\r\n&nbsp;&nbsp;&nbsp; Socks<br />\r\n&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<h3><br />\r\n<strong>CUT ABOVE THE REST&nbsp; $720</strong></h3>\r\n\r\n<p>Welcome to Our Premium Pure wool superior 100&#39;s fine wool suit package. This is for the man who enjoys fine clothing and embellishments.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp; Pure Wool Superior 100s&#39; Suit<br />\r\n&nbsp;&nbsp;&nbsp; Pure Cotton Shirt<br />\r\n&nbsp;&nbsp;&nbsp; Silk Tie/ Hank Box set<br />\r\n&nbsp;&nbsp;&nbsp; Tie Bar and Cuff-links<br />\r\n&nbsp;&nbsp;&nbsp; Socks<br />\r\n&nbsp;</p>\r\n\r\n<p>Options</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp; Waist coats, Silk Ties, Watches,SLATTERS Shoes</p>', NULL, NULL, NULL, NULL, 'files/Suits/Formal_Suit Hire_57.jpg', 'files/page-banners/SuitHiretemplate.png', 99, 0, 0, 0, 'Great Value Suits, Budget suits, Men\'s Suits Adelaide, Quality men\'s Suits, Men\'s Suits Adelaide South', NULL, 1660623075, NULL, 1663741246, 5),
(192, 'Kilt Packages', 'kilt-packages', NULL, 8, NULL, NULL, '<h2>Kilt Packages</h2>\r\n\r\n<p>Looking to purchase a complte Kilt outfit with out the fuss, We have several complete kilt packages for you to consider</p>\r\n\r\n<p>Formal Kilt Package</p>', NULL, NULL, NULL, NULL, 'files/kilts/Dress Rangers.jpg', 'files/page-banners/Kilt Hire Adelaide.jpeg', 45, 0, 0, 0, NULL, 'Kilt Packages', 1663566719, NULL, 1663741086, NULL),
(193, 'Holliday On Us', 'holliday-on-us', NULL, 81, NULL, NULL, '<p>For a limmited time we have a fantastic offer to our customers who spend $999 or more on Suit Hire or Suit Sales. You will receive 7 nights accommodation on us in<strong> Bali, Phuket or Mombasa.</strong> This offer is available for a limited time so don&#39;t miss out.</p>\r\n\r\n<p>Visit us in store for more details</p>\r\n\r\n<h2><strong><a href=\"https://www.scottfergusonformalwear.com.au/booking\"><span style=\"color:#0000FF\">Book your Fitting Today</span></a></strong></h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>My Great Escapes Destinations</h2>\r\n\r\n<h2><strong>Bali</strong></h2>\r\n\r\n<p><a href=\"https://mygreatescapes.com.au/bali-seascape-beach-club/\"><strong>Bali Seascape Beach Club</strong></a></p>\r\n\r\n<p><a href=\"https://mygreatescapes.com.au/bali-palms-resort/\"><strong>Bali Palms Resort</strong></a></p>\r\n\r\n<p>Bali is part of the Coral Triangle, the area with the highest biodiversity of marine species. In this area alone, over 500 reef-building coral species can be found. For comparison, this is about seven times as many as in the entire Caribbean.<br />\r\nBeing just 8 degrees south of the equator, Bali has a fairly even climate all year round. Average year-round temperature stands at around 30 &deg;C with a humidity level of about 85%. Day time temperatures at low elevations vary between 20 to 33 &deg;C .</p>\r\n\r\n<h2><strong>Phuket</strong></h2>\r\n\r\n<p><a href=\"https://mygreatescapes.com.au/absolute-twin-sands/\">Absolute Twin Sands</a></p>\r\n\r\n<p>Absolute Twin Sands is a stunning resort with panoramic ocean views, contemporary apartments and five-star service, all in a spectacular peninsula setting minutes from Patong on the stunning island of Phuket. Nestled between two perfect white sand beaches, every one of the 45 apartments and penthouses enjoy breathtaking views of the Andaman Sea.<br />\r\nThe suites, available as studio, one and two bedroom, combine the best of contemporary design, architecture and furniture to create a comfortably chic holiday retreat for couples and families alike.</p>\r\n\r\n<h2>Mombosa</h2>\r\n\r\n<p><a href=\"https://mygreatescapes.com.au/the-mnarani-club-kilifi-creek/\">Mnarani Creek Kilifi Club</a></p>\r\n\r\n<p>Situated 60 kilometres North of Mombasa on the cliffs of Kilifi Creek, just where the creek meets and merges with the Indian Ocean is an idyllic retreat and holiday destination The Mnarani Club. Set in 40 acres of landscaped tropical garden, fragranced by Frangipani blossoms and balmy ocean breezes.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Terms and Conditions</strong></p>\r\n\r\n<p>Scott Ferguson Formal-wear is not connected to or responsible for any part of the Booking of your holiday. We are not liable for any costs that are outside of the provided&nbsp; Voucher for 7 Nights Accommodation, fees, charges and flights are the responsibility of the voucher recipient&nbsp; please note that<span style=\"color:#008000\"> </span><a href=\"https://mygreatescapes.com.au/terms-conditions/\"><span style=\"color:#008000\">terms and conditions apply.</span></a></p>', 'Gift', NULL, NULL, NULL, 'files/Holliday Offers/The Mnarani Beach Club- Mombasa.png', 'files/page-banners/Promotion.png', 19, 0, 0, 1, 'Special offers', 'We have a fantastic offer to our customers who spend $999 or more on Suit Hire or Suit Sales. You will receive 7 nights accommodation on us in Bali, Phuket or Mombasa. This is available for a limited time so dont miss out.', 1665375820, NULL, 1705460074, 5),
(194, 'January 2025 Group Hire Offer', 'january-2025-group-hire-offer', NULL, 81, NULL, NULL, '<p><strong>Getting Married in January 2025.</strong> Recieve 50% off the Grooms Kilt or Suit Hire with Scott Ferguson Formal wear.</p>\r\n\r\n<p>We are Offering 50% off the Grooms Suit Hire or Kilt Hire when he books 4 other full Hire Suits or Kilts, This can be friends, fathers or just groomsmen.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<h2 style=\"text-align: center;\"><strong><em>&nbsp; Book 4 Full Hires and the 5th is 50% off</em></strong></h2>\r\n	</li>\r\n	<li>\r\n	<h2 style=\"text-align: center;\"><em><strong>&nbsp; Book 5 Full Hires and the 6th is FREE</strong></em></h2>\r\n	</li>\r\n</ul>\r\n\r\n<p style=\"text-align: center;\"><strong><span style=\"font-size:14px\"><span style=\"color:#0000CD\">This Offer is Valid for January 2025 weddings only</span></span></strong></p>\r\n\r\n<h1 style=\"text-align: center;\">&nbsp;</h1>', '50% Off', NULL, NULL, NULL, 'files/gallery/g1.jpg', 'files/page-banners/SuitHiretemplate.png', 10, 0, 0, 1, 'Scott Ferguson Formalwear January wedding Special offers', 'Getting Married in January 2025. Get  50% off the Grooms Kilt or Suit Hire with Scott Ferguson Formal wear.', 1705461869, NULL, 1705461869, NULL),
(195, 'August 2024 Group Hire Deal', 'august-2024-group-hire-deal', NULL, 81, NULL, NULL, '<p>Getting Married in August 2024. Recieve&nbsp; 50% off the Grooms Kilt or Suit Hire with Scott Ferguson Formal wear.</p>\r\n\r\n<p>We are Offering 50% off the Grooms Suit Hire or Kilt Hire when he books 4 other full Hire Suits or Kilts, This can be friends, fathers or just groomsmen.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>\r\n	<h2><strong><em>&nbsp; Book 4 Full Hires and the 5th is 50% off</em></strong></h2>\r\n	</li>\r\n	<li>\r\n	<h2><em><strong>&nbsp; Book 5 Full Hires and the 6th is FREE</strong></em></h2>\r\n	</li>\r\n</ul>\r\n\r\n<h1 style=\"text-align:center\"><span style=\"font-size:14px\"><span style=\"color:#0000CD\"><strong>This Offer is Valid for August 2024 weddings only</strong></span></span></h1>', '50% Off', NULL, NULL, NULL, 'files/gallery/g2.jpg', 'files/page-banners/Banner-2suit.png', 12, 0, 0, 1, 'August Wedding Special 50% Off Suit Hire', 'Getting Married in August 2024. Get  50% off the Grooms Kilt or Suit Hire with Scott Ferguson Formal wear.', 1705462395, NULL, 1705463354, 5),
(196, 'School Formal Hire Deal', 'school-formal-hire-deal', NULL, 81, NULL, NULL, '<h1 style=\"text-align: center;\">Looking For a Great Deal on your School Formal Suit Hire.</h1>\r\n\r\n<h1 style=\"text-align: center;\"><br />\r\n<span style=\"color:#0000FF\"><span style=\"font-size:14px\"><strong>How does $35 Suit Hire Sound</strong></span></span></h1>\r\n\r\n<p style=\"text-align: center;\"><strong>School formals are more fun with your mates, Have 4 Friends book a School Formal Suit Hire package with us and get your hire for $35</strong></p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"color:#A52A2A\"><span style=\"font-size:14px\"><strong>Thats a saving of $125</strong></span></span></p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"color:#A52A2A\"><span style=\"font-size:14px\"><strong>or</strong></span></span></p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"color:#A52A2A\"><span style=\"font-size:14px\"><strong>Thats $25 off each Hire</strong></span></span></p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"color:#A52A2A\"><span style=\"font-size:14px\"><strong>Thats $125 towards Limo Hire</strong></span></span></p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"color:#A52A2A\"><span style=\"font-size:14px\"><strong>Thats $125 Towards Uber and Uber eats</strong></span></span></p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"color:#A52A2A\"><span style=\"font-size:14px\"><strong>for those over 18 thats a good deal.</strong></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Book Your Group Fitting Now</p>\r\n\r\n<p>Offer available to the 1st of 5 School Formal Hire&#39;s, Individuals must mention Name of Nominated reciepent if not in a group booking.</p>\r\n\r\n<p>&nbsp;</p>', '35', NULL, NULL, NULL, 'files/Suits/Scott ferguson formalwear_3540.png', 'files/page-banners/SuitHiretemplate.png', 1, 0, 0, 1, 'School Formal Suit Hire Special $35', 'School Formal Suit Hire deal $35 at Scott Ferguson Formal Wear.', 1705464608, NULL, 1705464608, NULL);
